import React from 'react';

const SkillSwapMentorship = () => {
  return (
    <section>
      <h2>Skill Swap & Mentorship</h2>
      <p>
        Offer or request skill-sharing sessions (design, writing, coding, etc.) and match with mentors or mentees within the organization.
      </p>
      <p>Feature coming soon...</p>
    </section>
  );
};

export default SkillSwapMentorship;
